import React from 'react'
import { About,Contact, Footer, Hero, Navbar, Projects, Services } from './components';
import './App.css';

const App = () => {
  return (
    <div className='header'>
      <div className='header container'>
        <div className='nav-bar'>
          <div className='brand'>
            <Hero />
          </div>
        </div>
      </div>

    </div>
  )
}



export default App;
